import React from 'react'
import './Home.css'
let text = "Text 1";

const textchange = setInterval(function() {
  if (text === " I Am Text 1") {
    text = "I Am Text 2";
  } else {
    text = "Text 1";
  }
  document.getElementById("myText").innerHTML = text;
}, 5000);


function Home() {
  return (
    <>
    <div className="home-background">
        <div className="name">
           <h1><h1>OJAS <span className='surname'>DHAR</span></h1></h1>
        </div>
        <div id="changing-text">
          <h2>Hey, I am {textchange}</h2>
        </div>
    </div>
    </>
  )
}

export default Home
